import React from 'react';

import './index.css';

function Search() {
    return (
        <div className="lf_search">
            <div className="lf_search-input">
                <input placeholder="Search for video"/>
            </div>
            <div className="lf_search-icon">
                Search for shit
            </div>
        </div>
    )
}

export default Search;
